import React from 'react';
import './boxmessage.css';

const BoxMessage = () => {
	return (
		<div>
			<div class="card">
				<div class="card-body">
					<p class="card-text">
						Some quick example text to build on the panel title and make up the bulk of the panel's content.
						Some quick example text to build on the panel title and make up the bulk of the panel's content.
					</p>
				</div>
			</div>
		</div>
	);
};

export default BoxMessage;
